import { ItemDetail } from '../ItemDetail'
import ItemList from '../ItemList/ItemList'


const inmueble = [ 
  {id:1,
  nombre:"Proyecto Plaza El Golf", 
  image:"s.png", 
  ubicacion: "Las Condes",
  precio: "8.500 UF", 
  tipologia: "4D, 2B", 
  metraje: "150 MT2", 
  title: "Depto en Las Condes, Golf",
  descripcion: "Lindo proyecto emplazado en la zona oriente de Santiago, con excelente ubicación, y cerca de la zona empresarial más importante del país."},


  {id:2,
  nombre:"",
  image:"", 
  ubicacion: "",
  precio: "4.500 UF", 
  tipologia: "4D, 2B", 
  metraje: "90 MT2", 
  title: "Depto en Las Condes",
  descripcion: "asa"},

  {id:3,
  nombre:"",
  image:"", 
  ubicacion: "",
  precio: "4.500 UF", 
  tipologia: "4D, 2B", 
  metraje: "90 MT2", 
  title: "Depto en Las Condes",
  descripcion: "asa"},

  {id:4,
  nombre:"",
  image:"", 
  ubicacion: "",
  precio: "4.500 UF", 
  tipologia: "4D, 2B", 
  metraje: "90 MT2", 
  title: "Depto en Las Condes",
  descripcion: "asa"},

];

export const ItemDetailContainer = () => {
  const [data, setData] = useState({});
  useEffect (() => {
    const getData = new Promise(resolve => {
      setTimeout(()=>{
        resolve(inmueble);
      }, 2000);
    });
    getData.then(resultado => setData(resultado));
  }, [])
  return (
    <>
    <ItemDetail data={data}/>
    <ItemList/>
    </>
  )
}

export default ItemDetailContainer;
